def generate_matrix(N):
    matrix = np.zeros((N,N))
    for i in range(N): 
        row = i // 2
        col = i % 2
        if col == 0: 
            matrix[row,col] = i * i
        elif col == 1: 
            matrix[row,col] = (i * i) + 1
        else: 
            matrix[row,col] = (i * i) + 2
    return matrix
